DROP TABLE IF EXISTS "public"."pay_merchant";
CREATE TABLE "public"."pay_merchant" (
  "id" int8 NOT NULL,
  "no" varchar(32) COLLATE "pg_catalog"."default" NOT NULL,
  "name" varchar(64) COLLATE "pg_catalog"."default" NOT NULL,
  "short_name" varchar(64) COLLATE "pg_catalog"."default" NOT NULL,
  "status" int2 NOT NULL,
  "remark" varchar(255) COLLATE "pg_catalog"."default",
  "creator" varchar(64) COLLATE "pg_catalog"."default",
  "create_time" timestamp(6) NOT NULL,
  "updater" varchar(64) COLLATE "pg_catalog"."default",
  "update_time" timestamp(6) NOT NULL,
  "deleted" int2 NOT NULL DEFAULT 0,
  "tenant_id" int8 NOT NULL DEFAULT 0
)
;
ALTER TABLE "public"."pay_merchant" OWNER TO "postgres";
COMMENT ON COLUMN "public"."pay_merchant"."id" IS '商户编号';
COMMENT ON COLUMN "public"."pay_merchant"."no" IS '商户号';
COMMENT ON COLUMN "public"."pay_merchant"."name" IS '商户全称';
