COMMENT ON COLUMN "public"."pay_merchant"."create_time" IS '创建时间';
COMMENT ON COLUMN "public"."pay_merchant"."updater" IS '更新者';
COMMENT ON COLUMN "public"."pay_merchant"."update_time" IS '更新时间';
COMMENT ON COLUMN "public"."pay_merchant"."deleted" IS '是否删除';
COMMENT ON COLUMN "public"."pay_merchant"."tenant_id" IS '租户编号';
COMMENT ON TABLE "public"."pay_merchant" IS '支付商户信息';

