COMMENT ON COLUMN "public"."pay_order"."channel_fee_amount" IS '渠道手续金额，单位：分';
COMMENT ON COLUMN "public"."pay_order"."status" IS '支付状态';
COMMENT ON COLUMN "public"."pay_order"."user_ip" IS '用户 IP';
COMMENT ON COLUMN "public"."pay_order"."expire_time" IS '订单失效时间';
COMMENT ON COLUMN "public"."pay_order"."success_time" IS '订单支付成功时间';
COMMENT ON COLUMN "public"."pay_order"."notify_time" IS '订单支付通知时间';
COMMENT ON COLUMN "public"."pay_order"."success_extension_id" IS '支付成功的订单拓展单编号';
COMMENT ON COLUMN "public"."pay_order"."refund_status" IS '退款状态';
COMMENT ON COLUMN "public"."pay_order"."refund_times" IS '退款次数';
COMMENT ON COLUMN "public"."pay_order"."refund_amount" IS '退款总金额，单位：分';
COMMENT ON COLUMN "public"."pay_order"."channel_user_id" IS '渠道用户编号';
COMMENT ON COLUMN "public"."pay_order"."channel_order_no" IS '渠道订单号';
COMMENT ON COLUMN "public"."pay_order"."creator" IS '创建者';
COMMENT ON COLUMN "public"."pay_order"."create_time" IS '创建时间';
COMMENT ON COLUMN "public"."pay_order"."updater" IS '更新者';
COMMENT ON COLUMN "public"."pay_order"."update_time" IS '更新时间';
COMMENT ON COLUMN "public"."pay_order"."deleted" IS '是否删除';
COMMENT ON COLUMN "public"."pay_order"."tenant_id" IS '租户编号';
COMMENT ON TABLE "public"."pay_order" IS '支付订单
';

