-- ----------------------------
-- Table structure for pay_refund
-- ----------------------------
DROP TABLE IF EXISTS "public"."pay_refund";
CREATE TABLE "public"."pay_refund" (
  "id" int8 NOT NULL,
  "merchant_id" int8 NOT NULL,
  "app_id" int8 NOT NULL,
  "channel_id" int8 NOT NULL,
  "channel_code" varchar(32) COLLATE "pg_catalog"."default" NOT NULL,
  "order_id" int8 NOT NULL,
  "trade_no" varchar(64) COLLATE "pg_catalog"."default" NOT NULL,
  "merchant_order_id" varchar(64) COLLATE "pg_catalog"."default" NOT NULL,
  "merchant_refund_no" varchar(64) COLLATE "pg_catalog"."default" NOT NULL,
  "notify_url" varchar(1024) COLLATE "pg_catalog"."default" NOT NULL,
  "notify_status" int2 NOT NULL,
  "status" int2 NOT NULL,
  "type" int2 NOT NULL,
  "pay_amount" int8 NOT NULL,
  "refund_amount" int8 NOT NULL,
  "reason" varchar(256) COLLATE "pg_catalog"."default" NOT NULL,
  "user_ip" varchar(50) COLLATE "pg_catalog"."default",
  "channel_order_no" varchar(64) COLLATE "pg_catalog"."default" NOT NULL,
  "channel_refund_no" varchar(64) COLLATE "pg_catalog"."default",
  "channel_error_code" varchar(128) COLLATE "pg_catalog"."default",
  "channel_error_msg" varchar(256) COLLATE "pg_catalog"."default",
  "channel_extras" varchar(1024) COLLATE "pg_catalog"."default",
  "expire_time" timestamp(6),
  "success_time" timestamp(6),
  "notify_time" timestamp(6),
  "creator" varchar(64) COLLATE "pg_catalog"."default",
  "create_time" timestamp(6) NOT NULL,
  "updater" varchar(64) COLLATE "pg_catalog"."default",
  "update_time" timestamp(6) NOT NULL,
  "deleted" int2 NOT NULL DEFAULT 0,
  "tenant_id" int8 NOT NULL DEFAULT 0
)
;
ALTER TABLE "public"."pay_refund" OWNER TO "postgres";
COMMENT ON COLUMN "public"."pay_refund"."id" IS '支付退款编号';
COMMENT ON COLUMN "public"."pay_refund"."merchant_id" IS '商户编号';
COMMENT ON COLUMN "public"."pay_refund"."app_id" IS '应用编号';
COMMENT ON COLUMN "public"."pay_refund"."channel_id" IS '渠道编号';
COMMENT ON COLUMN "public"."pay_refund"."channel_code" IS '渠道编码';
COMMENT ON COLUMN "public"."pay_refund"."order_id" IS '支付订单编号 pay_order 表id';
COMMENT ON COLUMN "public"."pay_refund"."trade_no" IS '交易订单号 pay_extension 表no 字段';
COMMENT ON COLUMN "public"."pay_refund"."merchant_order_id" IS '商户订单编号（商户系统生成）';
COMMENT ON COLUMN "public"."pay_refund"."merchant_refund_no" IS '商户退款订单号（商户系统生成）';
COMMENT ON COLUMN "public"."pay_refund"."notify_url" IS '异步通知商户地址';
COMMENT ON COLUMN "public"."pay_refund"."notify_status" IS '通知商户退款结果的回调状态';
COMMENT ON COLUMN "public"."pay_refund"."status" IS '退款状态';
COMMENT ON COLUMN "public"."pay_refund"."type" IS '退款类型(部分退款，全部退款)';
COMMENT ON COLUMN "public"."pay_refund"."pay_amount" IS '支付金额,单位分';
COMMENT ON COLUMN "public"."pay_refund"."refund_amount" IS '退款金额,单位分';
COMMENT ON COLUMN "public"."pay_refund"."reason" IS '退款原因';
COMMENT ON COLUMN "public"."pay_refund"."user_ip" IS '用户 IP';
COMMENT ON COLUMN "public"."pay_refund"."channel_order_no" IS '渠道订单号，pay_order 中的channel_order_no 对应';
COMMENT ON COLUMN "public"."pay_refund"."channel_refund_no" IS '渠道退款单号，渠道返回';
COMMENT ON COLUMN "public"."pay_refund"."channel_error_code" IS '渠道调用报错时，错误码';
COMMENT ON COLUMN "public"."pay_refund"."channel_error_msg" IS '渠道调用报错时，错误信息';
COMMENT ON COLUMN "public"."pay_refund"."channel_extras" IS '支付渠道的额外参数';
COMMENT ON COLUMN "public"."pay_refund"."expire_time" IS '退款失效时间';
COMMENT ON COLUMN "public"."pay_refund"."success_time" IS '退款成功时间';
COMMENT ON COLUMN "public"."pay_refund"."notify_time" IS '退款通知时间';
COMMENT ON COLUMN "public"."pay_refund"."creator" IS '创建者';
COMMENT ON COLUMN "public"."pay_refund"."create_time" IS '创建时间';
COMMENT ON COLUMN "public"."pay_refund"."updater" IS '更新者';
COMMENT ON COLUMN "public"."pay_refund"."update_time" IS '更新时间';
COMMENT ON COLUMN "public"."pay_refund"."deleted" IS '是否删除';
COMMENT ON COLUMN "public"."pay_refund"."tenant_id" IS '租户编号';
COMMENT ON TABLE "public"."pay_refund" IS '退款订单';

